import react from "react";
import ChartBar from "./ChartBar";
import './Chart.css';

const Chart = props => {
    const totalMaximum = Math.max(props.chartData.map((data) => {
        return data.value 
    })) ;

    return 
    <div>
        {props.dataPoints.map((dataPoint) => {<div>
        <ChartBar 
            value={dataPoint.value}
            label={dataPoint.label}
            maxValue={totalMaximum}
            key={dataPoint.label}
        />
        </div>
        })}
    </div>
}

export default Chart;
